document.addEventListener('DOMContentLoaded', onDOMloaded, false);

var db = {};
var entry = {};
	
function onDOMloaded() {

	// This is a post (test comment) ?
	// But search result ?
	//if ($('ol.commentlist').length > 0) return;
	
	scrap1();
	console.log("%o", db);
	scrap2();
	
	// Create showImg background
	$('body').append('\n',
		$('<div>', { id:'showXXX' }).append(
			'\n', $('<img>', { id:'imgXXX' })
		)
	)
	$('#showXXX').on('mousedown', function() { $(this).hide(); });
	$('#showXXX').hide();
}

function scrap1() {
	$('div.post').each(function() {
		entry = {};
		entry.$ui = $(this);
		entry.id = $(this).attr('id').replace(/post-/, '');
		entry.url = $('li.topic a', $(this)).attr('href');
		db[entry.id] = entry;
	});
}

function scrap2() {
	$.each(db, function(id, entry) {
		
		$.get(entry.url)
		.done(function(data) {
			// extract post content
			var $e = $('div.post', $(data));
			scrap3(entry, $e);
		})
		.fail(function(jqxhr, textStatus, error) {
			console.log("Failed: " + error);
		});
	});
}

function scrap3(entry, $e) {
	// console.log("id=" + entry.id + " " + $e.attr('id'));
	entry.$links = $('a[href^="http://uploaded.net/"]', $e);
	
	if (entry.$links.length == 0) {
		entry.$links = $('a[href^="http://cosyupload.com/"]', $e);
	}
	
	// no link uploaded / cosyupload: no display
	if (entry.$links.length == 0) {
		entry.$ui.remove();
		return;
	}
	
	// Get all <a><img>
	entry.$imgs = $('a:has(img)', $e);
	
	// Add inner post images
	$ui = $('div.entry', entry.$ui);
	scrap4($ui, entry);
}

function scrap4($ui, entry) {
	// Main image
	var $main = $('a:has(img)', $ui);
	var href = $main.attr('href');
	
	entry.$imgs.each(function() {
		// This is the main image
		if ($(this).attr('href') == href) return;
		
		$main.after(
			'\n',
			$(this)
		);
	});
	
	// Add show image KO
	/*
	$('img', $ui).each(function() {
		$(this).on('mousedown', function() {
			showImg($(this).attr('src'));
		});
	});
	*/
	// Add new tab
	$('a:has(img)', $ui).each(function() {
		$(this).attr('target', '_blank');
	});
	
	$anchor = $('<div>', { 'class': 'links-ul' });
	$ui.prepend(
		'\n',
		$('<p>').text(entry.id),
		$anchor
	);
	entry.$links.each(function() {
		// cosyupload link
		if ($(this).attr('href').indexOf('cosyupload') >= 0) {
			getCosyupload($anchor, $(this).attr('href').replace(/http:\/\/cosyupload.com\/uploads\//, ''));
		}
		else {
			$anchor.append(
				'\n',
				$('<p>').append(
					$('<a>', { 'href': $(this).attr('href') }).text($(this).attr('href'))
				)
			);
		}
	});
}

function getCosyupload($anchor, id) {
	$.getJSON('https://cosyupload.com/uploads/open_link/', {upload_id:id, server:'uploaded_net'})
	.done(function(data) {
		$anchor.append(
			'\n',
			$('<p>').append(
				$('<a>', { 'href': data.link }).text(data.link)
			)
		)
	})
	.fail(function(jqxhr, textStatus, error) {
		console.log("Failed: " + error);
	});
}

